import React, { useEffect, useState } from "react";
import API from "../api";

const EmployeeList = () => {
  const [employees, setEmployees] = useState([]);

  const loadEmployees = async () => {
    const response = await API.get("/employees");
    setEmployees(response.data);
  };

  const deleteEmployee = async (empid) => {
    await API.delete(`/employee/${empid}`);
    loadEmployees();
  };

  useEffect(() => {
    loadEmployees();
  }, []);

  return (
    <div>
      <h2>Employee List</h2>
      <table border="1">
        <thead>
          <tr>
            <th>ID</th><th>Name</th><th>Age</th><th>Email</th>
            <th>Phone</th><th>Dept</th><th>Salary</th><th>Project</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {employees.map((e) => (
            <tr key={e.empid}>
              <td>{e.empid}</td>
              <td>{e.name}</td>
              <td>{e.age}</td>
              <td>{e.email}</td>
              <td>{e.phone}</td>
              <td>{e.dept}</td>
              <td>{e.salary}</td>
              <td>{e.curProject}</td>
              <td>
                <button onClick={() => deleteEmployee(e.empid)}>Delete</button>

                <button>Edit</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default EmployeeList;
